import axios from "axios";
import {BASE_URL} from "../constants/urls"
import{goToRecipesList} from "../routers/coordinator"

export const login=(body,clear,history)=>{

    axios.post(`${BASE_URL}/user/login`,body).then((res)=>{
       localStorage.setItem('token', res.data.token)
       clear()
       goToRecipesList(history)
    }).catch((err)=>{
       alert (err.response)
    })
};

export const SingUp=(body,clear,history)=>{

   axios.post(`${BASE_URL}/user/signup`,body).then((res)=>{
      localStorage.setItem('token', res.data.token)
      clear()
      goToRecipesList(history)
   }).catch((err)=>{
      alert ('Nome ou email não cadastrado')
   })
};
